::-webkit-scrollbar {
    width: 0.4em;
    height: 0;
    animation: barFadeIn 0.1s 1.1s forwards;
}

::-webkit-scrollbar-track {
    background: white;
    margin-block: 0.5em;
}

::-webkit-scrollbar-thumb {
    background: #212e53c4;
    // border: 1px solid rgba(44, 77, 94, 0.9); rgba(57, 107, 132, 0.91)
    border-radius: 100vw;

}

@keyframes barFadeIn {
    0% {
        opacity: 0;
    }

    100% {
        opacity: 1;
    }
}

